import React, { Component } from "react";

export interface IPokemonProps {
    pokemonName: string;
    pokemonNumber: number;
    shiny: boolean;
    urlImage: string;
    shinyUrlImage: string;
}

export class Pokemon extends Component<IPokemonProps, {}> {
    render() {
        return (
          <p>{this.props.pokemonName}</p>
        )
    }
}
